import React from 'react';
import Form from './Form';

function Header() {
  return (
    <div>
      <form>
        <div>
          <div>
            <Form name="name" placeholder="Name" />
          </div>
          <Form name="phone" placeholder="XXX-XXX-XXX" symbol="☏" />
          <Form name="email" placeholder="*****@gmail.com" />
          <Form name="website" placeholder="linkedin.com/in/.." />
          <Form name="location" placeholder="Phoenix, AZ" />
        </div>
      </form>
    </div>
  );
}

export default Header;
